import "./GameCell.css";

import React from "react";

class GameCell extends React.Component {
    constructor(props){
        super(props)
    }

    render(){
        let classes = 'gc-game-cell '+ this.props.className;
        return (
            <div className={classes}>
                <span>
                    {this.props.pattern}
                </span>
            </div>
        );
    }


}

export default GameCell;
